        uint256 count;
        for (uint256 i = 1; i <= saleCounter; i++) {
            if (sales[i].status == SaleStatus.Listed) {
                count++;
            }
        }
        uint256[] memory listedIds = new uint256[](count);
        uint256 index;
        for (uint256 i = 1; i <= saleCounter; i++) {
            if (sales[i].status == SaleStatus.Listed) {
                listedIds[index] = i;
                index++;
            }
        }
        return listedIds;
    }
